import React from 'react';

const Header = () => {
  return (
    <header className="bg-sky-blue px-8 py-4 flex justify-between items-center">
      <div className="text-white font-bold text-2xl">
        VDS
      </div>
      <nav className="flex space-x-8">
        <a href="#home" className="text-white font-medium hover:underline">HOME</a>
        <a href="#about" className="text-white font-medium hover:underline">ABOUT</a>
        <a href="#testimonials" className="text-white font-medium hover:underline">TESTIMONIALS</a>
        <a href="#sponsors" className="text-white font-medium hover:underline">SPONSORS</a>
        <a href="#faq" className="text-white font-medium hover:underline">FAQ</a>
      </nav>
    </header>
  );
};

export default Header;
